// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.7.0 <=0.8.3;

contract HealthRecord{
    
    address private contractOwner;
    
    struct UserResult{
        string testResult;
        string date;
        string place;
    }
    
    struct PendingTransaction{
        UserResult result;
        bool paid;
        uint256 amount;
        address payableTo;
        
    }
    
    struct User{
        address userAddress;
        UserResult[] results;
        PendingTransaction[] pendingResult;
    }
    
    struct ProviderUser{
        address userAddress;
        string location;
        string placeName;
        bool isActive;
        
    }
    
    // struct HospitalUser{
    //     address userAddress;
    //     string location;
    //     string placeName;
    //     bool isActive;
    // }
    
    ProviderUser[] private hospitalList; // just a list 
   // mapping (address => HospitalUser) private hospital;
    mapping (address => ProviderUser) private provider;
    mapping (address  => User) private users; // maybe change to private
    
    
    constructor (){
        contractOwner = msg.sender;
    }
    
    //add users
    function registerUser(address user_) public{
       // require(msg.sender == user_);
        users[user_].userAddress = user_;
        
    }
    
    
    function registerKiosk(address kiosk_, string memory location_, string memory name_) public{
        require(msg.sender == contractOwner, "Only contract owner can do this.");
        provider[kiosk_].userAddress = kiosk_;
        provider[kiosk_].location = location_;
        provider[kiosk_].placeName = name_;
        provider[kiosk_].isActive = true;
    }
    
    function registerHospital(address hospital_, string memory location_, string memory name_) public{
        require(msg.sender == contractOwner, "Only contract owner can do this.");
        ProviderUser memory hUser = ProviderUser(hospital_, location_, name_, true);
        provider[hospital_] = hUser;
        hospitalList.push(hUser);
    }
    
    function disableProvider(address provider_) public{
        require(msg.sender == contractOwner, "Only contract owner can do this.");
        provider[provider_].isActive = false;
    }
  
    
    function getProviderInfo(address provider_) public view returns(string memory, string memory){
        require(provider[provider_].isActive);
        return(
            provider[provider_].placeName,
            provider[provider_].location
            );
        
    }
    
    
    //add record as kiosk
    function addHealthRecord(address endUser, string memory testresult_, string memory temp_, string memory place_) public{
        require(provider[msg.sender].isActive == true);
        UserResult memory result_ = UserResult(testresult_, temp_, place_);
        users[endUser].results.push(result_);
    }
    
    //get record as user
    function getHealthRecord(uint count_ , address user_) public view returns(string memory , string memory){
        return (users[user_].pendingResult[count_].result.testResult, users[user_].pendingResult[count_].result.place );
    }
    
    
    //add transaction 
    function addPendingHealthRecord(string memory testResult_, string memory date_, string memory place_ , address endUser, uint256 amount_) public{
        require(provider[msg.sender].isActive == true );
        UserResult memory resultData = UserResult(testResult_, date_, place_);
        PendingTransaction memory pendingResult_ = PendingTransaction(resultData, false, amount_, msg.sender);
        users[endUser].pendingResult.push(pendingResult_);
        

    }
    
    //get record as user
    function getPendingHealthRecord(uint count_, address user_) public view returns(string memory, string memory, string memory, uint256, bool, address  ){
        require(msg.sender == user_);
        return (users[user_].pendingResult[count_].result.testResult, 
                users[user_].pendingResult[count_].result.date , 
                users[user_].pendingResult[count_].result.place,
                users[user_].pendingResult[count_].amount,
                users[user_].pendingResult[count_].paid,
                users[user_].pendingResult[count_].payableTo
                
        );
    }
    
    
    function getPendingHealthRecordLength (address user_) public view returns (uint256){
        require(msg.sender == user_);
        return(users[user_].pendingResult.length);
    }
    
    
    
    function getOwner() public view returns (address){
        return(contractOwner);
    }
    
    
    
    
}
